tables.table_schema:
CREATE TABLE Performance_Metrics ( metric_id UUID PRIMARY KEY,
                     metric_name VARCHAR(255),
                     metric_description TEXT,
                     metric_value DECIMAL(10,2),
                     metric_date DATE
);

CREATE TABLE Consultation_Trends ( trend_id UUID PRIMARY KEY,
                     trend_name VARCHAR(255),
                     trend_description TEXT,
                     trend_value DECIMAL(10,2),
                     trend_date DATE
);

CREATE TABLE Improvement_Strategies ( strategy_id UUID PRIMARY KEY,
                     strategy_name VARCHAR(255),
                     strategy_description TEXT,
                     strategy_owner UUID,
                     strategy_status VARCHAR(50)
);

CREATE TABLE consultation_users (
  user_id INT PRIMARY KEY,
  user_name VARCHAR(255),
  user_email VARCHAR(255),
  user_role VARCHAR(255)
);

CREATE TABLE consultation_analysis (
  analysis_id INT PRIMARY KEY,
  analysis_date DATE,
  analysis_type VARCHAR(255),
  analysis_results TEXT
);
